import { NetworkManager } from "../../classes-shared/networkManager";
import { KickPlus } from "../main";
const temp = "data:image/png;base64,"
export class EmoteGrabber{
    static #isOn=false;
    static #currentElement=null;
    static on(){
        if(this.#isOn) return;
        this.#isOn = true;
        //get element right clicked on
        document.addEventListener("contextmenu", this.#handleContextMenu.bind(this), true);
        chrome.runtime.onMessage.addListener(this.#handleOnMessage.bind(this));
    }

    static update(){
        return;
        this.off();
        this.on();
    }

    static #handleOnMessage(data){
        if (data.type === "emoteGrabber"){
            //make sure its an emote
            const emoteName = this.#currentElement?.alt;
            if(KickPlus.streamerData && emoteName && KickPlus.emoteKeys.includes(emoteName)){
                //try to add the emote
                try{
                    NetworkManager.addEmote(emoteName, temp)//KickPlus.streamerData.emotes[emoteName])
                    .then(()=>{console.log("adding")})
                    .catch(()=>{console.error("KickPlus: failed adding emote")})
                }catch{
                    console.error("KickPlus: failed getting uuid")
                }
                
            }
            
        }else{
            return true;
        }
    }

    static #handleContextMenu(e){
        this.#currentElement = e.target;
    }

    static off(){
        document.removeEventListener("contextmenu", this.#handleContextMenu.bind(this));
        chrome.runtime.onMessage.removeListener(this.#handleOnMessage.bind(this));
        this.#isOn = false;
    }
}